window.bookSummaryJSON = "<p>I am a Sovereign Son. A king within the Society.</p> <p>With a look, I send men to their knees.</p> <p>Yet she stands tall against me, taunting me with her rebellion. </p> <p>But we all have rules we must live by. </p> <p>Even me. </p> <p>And I have broken the most sacred. </p> <p>I took her to my bed. </p> <p>I claimed that which did not belong to me. </p> <p>And now that the beast within has had a taste, it wants more.</p>"; 
